GetActivities.desc:
GetActivities returns a list of object of currently running activities.
{
	label: string,
	packageName: string,
	className: string
}

GetIntent.desc:
returns an intent object sent to the app with the following style:

{
	action: string,
	type: string,
	data: string,
	flags: integer,
	extras: {
		app_intent: string,
		app_file: string, (path to app source file, ex: "/sdcard/DroidScript/appname/appname.js")
		app_options: string (ex: "remote"
	}
}
